var Storage=function(t){this.key=t,this.saveValue=function(t){var e=JSON.parse(localStorage.getItem(this.key));return e.push(t),localStorage.setItem(this.key,JSON.stringify(e))},this.getValue=function(){return JSON.parse(localStorage.getItem(this.key))},this.initialize=function(){return localStorage.setItem(this.key,JSON.stringify([]))},this.removeValue=function(t){var e=this.getValue(),i=e.indexOf(t);if(i!==-1)return e.splice(i,1),localStorage.setItem(this.key,JSON.stringify(e))}};